INSERT INTO `articles` (`id_articles`, `title`, `description`, `thumbnail`, `date`, `id_categories`, `id_users`, `slug`, `status`) VALUES
(33, 'Polinela mengaji', '<p><b>Assalamu\'alaikum warahmatullahi wabarakatuh</b></p><p>Liburan telah usai‼️</p><p>Eitts ada info nih Kajian Rutin Al-Banna Is Back</p><p>Polinela Mengaji.&nbsp;<span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Kajian Rutin Senin Sore</span></p><p>Diisi oleh&nbsp;</p><ul><li><b>Pemateri : Abi Ansori&nbsp;</b></li><li><b>Judul : Management Cinta&nbsp;</b></li><li><b>Tempat : Masjid Al-Banna Politeknik Negeri Lampung.</b></li><li><b>Hari: Senin, 07 November 2022</b></li><li><b>Jam: 16.30 WIB&nbsp;</b></li></ul><p>Siapkan infaq terbaikmu</p><p><b>\"Barang siapa menempuh satu jalan (cara) untuk mendapatkan ilmu, maka Allah pasti mudahkan baginya jalan menuju surga.\" (HR. Muslim)</b></p><p>Wassalamu\'alaikum warahmatullahi wabarakatuh</p>', '1674181815_6b196dee5d945cf89550.jpeg', '2023-01-19', 12, 15, 'polinela-mengaji', 1),
(34, 'Malam Ukhuwah', '<p><b>&nbsp;Assalamu\'alaikum warahmatullahi wabarakatuh&nbsp;</b></p><p><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">TERUNTUK KELUARGA BESAR UKM AL-BANNA { ONLY IKHWAN }</span><br></p><p><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Insyaa Allah akan diadakan ACARA</span><br></p><p><b>\" MAKAH { Malam Ukhuwah }&nbsp;</b></p><p><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Dengan tema :&nbsp;</span><b style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">\" SEMANGAT BERBENAH, ERATKAN UKHUWAH\"</b></p><p>Yang Insya Allah akan dilaksanakan pada:</p><ul><li><b>Hari/Tanggal : Jum\'at, 21 Oktober 2022</b></li><li><b>Pukul&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : 16.00 WIB - Selesai</b></li><li><b>Tempat&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Masjid Al Banna</b></li><li><b>DC&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Baju Muslim Koko</b></li></ul><p><b>Benefit :</b></p><ul><li>Ilmu Yang Bermanfaat</li><li>Teman Baru</li><li>Makan BARENG</li><li>Riadoh Bareng</li><li>Snack</li></ul><p><b>&nbsp;NOTE :</b></p><ul><li>WAJIB MENGINAP</li><li>DI USAHAKAN ON TIME YA</li><li>Bawa baju ganti untuk olahraga</li></ul><p>Semoga Allah senantiasa merahmati Kita semuanya????</p><p><b>Hamasah!!!</b></p><p>&nbsp;Wassalamu\'alaikum warahmatullahi wabarakatuh</p><p><b>MEDIA UKM AL BANNA POLINELA</b></p><ul><li>Portal berita:albanna.kemahasiswaan.polinela.ac.id</li><li>Email : Albanna@polinela.ac.id</li><li>Facebook : Ukm Al Banna&nbsp;</li><li>IG : ldkalbannapolinela</li><li>Youtube : Ukm Al Banna</li><li>Twitter : @ukmalbanna</li></ul><p><b>#RumahUkhuwah&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">#KolabolatorKebaikan&nbsp;</span><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">#Man jadda wajada&nbsp;</span><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">#SyiarkanDakwah_EratkanUkhwah&nbsp;</span><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">#AlGhozi_Generation</span></b></p><p><b><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">#</span><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">LuruskanNiat_TegakkanTekad_TebarkanManfaat&nbsp;</span><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">#UKMAlBannaGenerasi23</span></b></p>', '1674182084_45c4f07cb9c449904f78.jpeg', '2023-01-19', 12, 15, 'malam-ukhuwah', 1),
(35, 'Liga Mahasiswa Polinela', '<p><b>Assalamualaikum Warahmatullahi Wabarakatuh</b></p><p>Salam Olahraga&nbsp;</p><p>Salam Satu Jiwa Semangat Sportifitas&nbsp;</p><p>Sehubung akan diadakan Liga Mahasiswa Polinela (LIMAPO) dengan mengusung tema \"Larutkan Perbedaan, Reaksikan Persamaan dan Hasilkan Prestasi\" oleh UKM Olahraga .</p><p>Dengan itu, UKM OLAHRAGA mengajak&nbsp; untuk ikut berpartisipasi dengan mengirimkan sebanyak 1 Tim per- Cabor untuk dapat mengikuti turnamen antar Program Studi.</p><p>Adapun cabang olahraga yang diikuti :</p><ol><li><b>Futsal (1Tim)</b></li><li><b>Basket (1Tim)</b></li><li><b>Voli (1Tim)</b></li><li><b>Badminton (1 Tim Per-kategori)</b></li><li><b>Tenis meja (1 Tim)</b></li><li><b>Catur (Max 2 orang)</b></li></ol><p><b>Timeline</b></p><ul><li>Registrasi : 19 - 22 Maret 2022</li><li>TM : 23-24 Maret 2022</li><li>Match Day : 25 - 28 Maret 2022</li></ul><p><b>Persyaratan</b></p><ol><li>Fotocopy KTM/KTP.</li><li>Menyertakan Invoice mahasiswa aktif (Genap).</li><li>Menyertakan foto 2 lembar ukuran 3x4.</li></ol><p><b>NOTE :</b></p><p>Form pendaftaran dan surat perjanjian di print, dan dikumpulkan pada saat registrasi. Para peserta yang ingin mengikuti dapat melakukan registrasi dengan cara Menghubungi Hima per - Program Studi</p>', '1674182233_573c8033f442d9619f4a.jpeg', '2023-01-19', 11, 20, 'liga-mahasiswa-polinela', 1),
(36, 'Musyawarah Besar UKM Albanna', '<p><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\"><b>بِسْــــــــــــــمِ اللهِ الرَّحْمَنِ الرَّحِيْـــــمِ</b></span><br></p><p>“Tidaklah suatu kaum berkumpul di salah satu rumah dari rumah-rumah Allah (masjid) membaca Kitabullah dan saling mempelajarinya, melainkan akan turun kepada mereka sakinah (ketenangan), mereka akan dinaungi rahmat, mereka akan dilingkupi para malaikat dan Allah akan menyebut-nyebut mereka di sisi para makhluk yang dimuliakan di sisi-Nya” (HR. Muslim no. 2699).</p><p><b>السلام عليكم ورحمة الله وباركا ته</b></p><p><b>Undangan&nbsp;</b></p><p>Keluarga Besar UKM AL-Banna Angkatan 20, 21, 22&nbsp;</p><p>Dalam rangka diadakan nya&nbsp; MUSBA ( Musyawarah Akbar ) kami mengundang Kawan-kawan Semua untuk hadir pada:</p><ul><li>Ahad, 25&nbsp; Desember 2022</li><li>Pukul 07.00 WIB s/d Selesai</li></ul><p><b>MUSBA ( Musyawarah Akbar UKM AL-BANNA)</b></p><ul><li>Gedung Sakura</li><li>15.000 ( untuk angkatan 21&amp;22 )</li><li>Angkatan 20 PDH Al Banna</li></ul><p><b>IKHWAN</b></p><ul><li>Angkatan 21 dan 22 Kemeja Putih, Celana dasar hitam + Almet</li></ul><p><b>AKHWAT</b></p><ul><li>Angkatan 21 dan 22 Kemeja Putih,Rok Hitam + Almet</li><li>Angkatan 22 Kemeja Putih,&nbsp; Celana Dasar Hitam</li></ul><p><b>NOTE : Wajib Hadir Keluarga Besar UKM AL BANNA !</b></p><p>Atas kehadirannya, kami ucapkan banyak terimakasih, Jazaakumullaah khair</p><p><b>السلام عليكم ورحمة الله وباركا ته</b></p>', '1674183877_56ba115d954463b4f1dc.jpeg', '2023-01-19', 12, 15, 'musyawarah-besar-ukm-albanna', 1),
(40, 'Universary UKM Bidang Seni ke 10', '<p><b>Assalamualaikum Warahmatullahi Wabarakatuh</b></p><p><b>Salam Budaya !!!</b></p><p>Pemberitahuan, kepada seluruh mahasiswa Politeknik Negeri Lampung, kalian semua di undang. Dalam acara&nbsp; Pentas Seni Sekaligus Anniversary UKMBS ke 10 pada :&nbsp;</p><ul><li><b>Hari/tgl: Selasa, 02 Agustus 2022</b></li><li><b>Waktu: 15.30 WIB s.d selesai</b></li><li><b>Tempat: GSG POLINELA</b></li><li><b>Dresscode: Childhood/Menyesuaikan</b></li></ul><p>Besar harapan kami rekan-rekan dapat hadir dan ikut memeriahkan acara kami pada waktu yang sudah ditentukan.</p><p><b>Terimakasih.</b></p><p>Wassalamu\'alaikum Warahmatullahi Wabarakatuh</p><p><b>Kami Komunitas Orang Gila Tapi Tidak Sakit Jiwa!!!</b></p>', '1674187701_0d0726c1a1977ec70961.jpeg', '2023-01-19', 12, 16, 'universary-ukm-bidang-seni-ke-10', 1),
(42, 'Lomba Lukis Dan Face Art', '<p><b>Assalamualaikum. Wr. Wb</b></p><p><b>Salam Budaya!!</b></p><p>Unit Kegiatan Mahasiswa Bidang Seni&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\"><b>Politeknik Negeri Lampung</b></span></p><p>Proudly present</p><p><b>LOMBA LUKIS DAN FACE ART</b></p><p>\"Lomba Lukis Dan Face Art diselenggarakan dengan harapan dapat Meningkatkan Kreativitas Serta Menumbuhkan Rasa Nasionalisme sebagai anak Bangsa Dalam Rangka Memperingati Hari Pahlawan”</p><p><b>HTM : Rp. 15.000,00</b></p><p><b>Time : 01 - 10 november 2020</b></p><p>Persyaratan Lomba</p><ol><li>Follow IG @ukm_bspolinela</li><li>Mengisi form pendaftaran pada link:&nbsp;<b style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">https://forms.gle/PGMoVmF5esF6b6jPA</b>(link on bio)</li><li>Melakukan registrasi. Bukti pembayaran di lampirkan pada formulir pendaftaran</li><li>Mengikuti kompetisi sesuai dengan syarat dan ketentuan yang berlaku</li></ol><p><b>Ketentuan Perlombaan</b></p><p>Lomba Lukis</p><ol><li><b>Tema : Pahlawan</b></li><li><b>Media : Bebas</b></li><li><b>Bersifat perorangan</b></li><li><b>Karya yang di ikut sertakan merupakan hasil karya sendiri dan belum pernah di ikut sertakan dalam lomba</b></li><li><b>Pengumpulan karya dapat diakses dilink:&nbsp;https://forms.gle/ph7RgjHYfGZrBfxT8</b></li></ol><p>berbentuk timelapse yang menyertakan proses melukis sampai dengan selesai. Durasi video maksimal 5 menit disertai foto hasil akhir.</p><p><b>Lomba Face Art</b></p><ol><li>Tema : Pahlawan</li><li>Media : Wajah</li><li>Hasil karya video max 2 orang</li><li>Peserta diharuskan membuat karya sesuai dengan tema yang telah ditentukan panitia</li><li>Pengumpulan karya dapat diakses dilink :&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\"><b>https://forms.gle/ph7RgjHYfGZrBfxT8</b></span></li></ol><p>berbentuk video Timelapse meliputi proses sampai dengan hasil akhir. Durasi video maksimal 5 menit disertai foto hasil akhir.&nbsp;<span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">The Winner :</span></p><ul><li><b>Juara 1 : Piala, sertifikat , uang pembinaan Rp 500.000,00</b></li><li><b>Juara 2 : Piala, sertifikat, uang pembinaan Rp 300.000,00</b></li><li><b>Juara 3 : Piala, srtifikat, uang pembinaan Rp 200.000,00</b></li></ul><p><b>Contact Person:</b></p><ul><li>Doy: +62 896-0996-6863</li><li>waselar : 0813-6385-3344</li></ul><p><b>LET\'S JOIN US‼️</b></p><p><b>Salam Budaya!!</b></p><p><b>\" Kami Komunitas Orang Gila&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">Tapi Tidak Sakit Jiwa \"</span></b></p><p><b>Wasalamualaikum Wr. Wb</b></p><p>#lombamelukisukmbs&nbsp;<span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">#event2020ukmbspolinela&nbsp;</span><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">#lombafaceartukmbs&nbsp;</span><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">#lombaukmbspolinela2020</span></p>', '1674284036_2e716d8e4ed5aac65391.jpeg', '2023-01-21', 11, 16, 'lomba-lukis-dan-face-art', 1),
(43, 'Webinar Seni Di Masa Pandemi', '<p><b>Assalamualaikum. Wr. Wb</b></p><p><b>SALAM BUDAYA!!</b></p><p>Unit Kegiatan Mahasiswa Bidang Seni&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\"><b>Politeknik Negeri Lampung</b></span></p><p>Proudly Present <span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Webinar Series Dengan Tema :</span></p><p><b>SENI DIMASA PANDEMI</b></p><p>Bersama dengan pemateri-pemateri kece yg ahli di bidangnya, yaitu :</p><p><b>Seni Rupa : VIDHER BAMBANG SUHARDI<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">( Mural Art, Painter )</span></b></p><p><b>Seni Tari : WIDYA RETNA NINGRUM&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">( Pendidikan Seni Tari UNILA 2017 )</span></b></p><p><b>‍Seni Musik : ASHARENO&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">( Musisi )</span></b></p><p><b>Moderator :</b></p><ol><li>Yulia Astutik</li><li>Akhila</li><li>Mega Apsari</li></ol><p><b>SAVE THE DATE‼️&nbsp;</b></p><p><span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\"><b>SENI RUPA</b></span></p><ul><li>Sabtu, 29 Mei 2021</li><li>08.00 – s/d selesai</li></ul><p><b>SENI TARI</b></p><ul><li>Sabtu, 05 Juni 2021</li><li>08.00 – s/d selesai</li></ul><p><b>SENI MUSIK</b></p><ul><li>Minggu, 06 Juni 2021</li><li>08.00 s/d selesai</li></ul><p><b>Fasilitas :</b></p><ol><li>E-SERTIFIKAT</li><li>Doorprize</li><li>Ilmu bermanfaat</li><li>Senyum manis panitia</li></ol><p><b>Note : FREE HTM</b></p><p>Syarat dan ketentuan :</p><ol><li>Mengisi form registrasi&nbsp;<span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Link : https://forms.gle/TprXRkgbxcDxR5PKA ( on bio IG : ukm_bspolinela )</span></li><li>Mengikuti acara hingga akhir</li><li>Mengisi daftar hadir</li><li>Jangan lupa ikut sesi foto bersama</li></ol><p><b>Contacts person&nbsp;&nbsp;<span style=\"font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">WA :</span></b></p><ol><li>+62 895 1839 7985 ( MANJAH )</li><li>+62 857 6885 5428 ( KEJAM )</li></ol><p><b>Portal media</b></p><ul><li><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Email : ukmbspolinela12@gmail.com</span></li><li>IG : ukm_bspolinela</li><li>Ytb : UKMBSpolinela</li></ul><p><b>LETS JOIN US‼️</b></p><p><b>SENI INOVATIF PANDEMI KREATIF</b></p><p><b>SALAM BUDAYA!!!</b></p><p><b>Kami Komunitas Orang Gila Tapi Tidak Sakit Jiwa!!!</b></p>', '1674284153_1539c3a5ccd739472440.jpeg', '2023-01-21', 9, 16, 'webinar-seni-di-masa-pandemi', 1);
