INSERT INTO `community` (`id_community`, `name`, `description`, `thumbnail`, `slug`) VALUES
(14, 'UKM Pers Sukma', '<p style=\"text-align: justify;\">Tentang UKM Pers SUKMA</p><p style=\"text-align: justify;\">Pers SUKMA (Suara Kreatifitas Mahasiswa) adalah salah satu Unit Kegiatan Mahasiswa (UKM) di Politeknik Negeri Lampung (Polinela) dan merupakan satu-satunya UKM yang bergerak dibidang Jurnalistik. SUKMA memiliki peran yang cukup penting sebagai kontrol sosial secara kritis, analisis, ilmiah dan bersifat membangun serta sebagai sumber informasi bagi civitas akademika Politeknik Negeri Lampung.</p><p style=\"text-align: justify;\">Pada awal terbentuk, UKM Pers SUKMA bernama Lembaga Pers Mahasiswa Suara Kreatifitas Mahasiswa yang disingkat menjadi LPM SKM. Namun, pada Sidang Umun Mahasiswa (SUM) yang ke-6 pada tanggal 15 September 2000, LPM SKM berganti nama menjadi LPM SUKMA. Lalu, Pada 3 Februari 2002 LPM SUKMA resmi berganti nama menjadi UKM Pers SUKMA sampai saat ini.</p>', '1671267817_951c4bf988cfa94c741c.png', 'ukm-pers-sukma'),
(15, 'UKM Al Banna', '<p style=\"text-align: justify; \">Sejarah UKM Al Banna Polinela | Politeknik Negeri Lampung pada awalnya dikenal dengan nama Politeknik Pertanian Negeri Lampung dan resmi menyelenggarakan pendidikan tinggi secara mandiri dan menjadi salah satu bentuk Perguruan Tinggi Negeri (PTN) di Provinsi Lampung sejak tanggal 7 April 2001, berdasarkan SK. Mendiknas RI No. 036/O/2001.<br></p>', '1674170237_5a3604ffde6896d79ac5.png', 'ukm-al-banna'),
(16, 'UKM Bidang Seni', '<p style=\"text-align: justify; \">Kami komunitas orang gila pada estetika dan ilmu, dan bukan sakit jiwa” itulah slogan pertama dari UKM Bidang Seni Polinela, yang sekarang sudah direvisi menjadi \"Kami Komunitas Orang Gila Tapi Tidak Sakit jiwa\". UKM Bidang Seni bergerak dalam bidang seni (musik, tari, theater, paduan suara dan perkusi).&nbsp;<span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight);\">Maka, jika kebetulan masuk ke Politeknik Negeri Lampung, mempunyai bakat dan ingin berprestasi di bidang seni, salurkanlah kreativitas dan kemampuanmu di UKMBS Polinela.&nbsp;</span><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight);\">Merupakan salah satu Unit Kegiatan Mahasiswa (UKM) di Perguruan Tinggi Polinela yang memiliki inovasi tersendiri dalam seni berorganisasi. Dengan visi menciptakan generasi muda yang berjiwa seni dan memiliki kreativitas yang tinggi dengan berlandaskan moral dan etika. dan menetapkan misim engembangkan bakat dan kreativitas mahasiswa Politeknik Negeri Lampung. Menjalin kerja sama dengan organisasi lainnya agar dapat saling mendukung untuk terciptanya organisasi yang produktif dan berkualitas.</span></p>', '1671268099_4c8304027d96fc3d052d.png', 'ukm-bidang-seni'),
(18, 'UKM Poltapala', '<p style=\"text-align: justify; \">Didirikan pada tanggal 25 Juli 1989, UKM ini Bernama POLTAPALA (POLITEKNIK PENCINTA ALAM LAMPUNG) Didirikan oleh sekelompok orang yang sadar dan peduli akan kelestarian lingkungan hidup.</p><p style=\"text-align: justify; \">VISI DAN MISI</p><p style=\"text-align: justify; \">VISI: Membentuk kepribadian mahasiswa yang&nbsp; &nbsp; kreatif dan bertanggung jawab terhadap lingkungn masyarakat.</p><p style=\"text-align: justify; \">MISI: Mewujudkan sumberdaya manusia yang peka terhadap alam dan lingkungan untuk melaksanakan fungsi sosial dan ikut serta mengatasi masalah alam, sosial dan lingkungan</p><div style=\"text-align: justify; \"><br></div>', '1671332359_d3184dcaf82f55cb201f.png', 'ukm-poltapala'),
(19, 'UKM Kopma ', '<p style=\"text-align: justify; \">UKM Kopma Mandiri adalah salah satu unit kegiatan mahasiswa di Politeknik Negeri Lampung, yang bergerak dibidang jasa dan penjualan. UKM Kopma Mandiri bertujuan membangun jiwa-jiwa wirausaha mahasiswa Politeknik Negeri Lampung dan diharapkan kelak Mahasiswa atau LULUSAN dari POLINELA bukan hanya mendapatkan pekerjaan, namun dapat membuka lapangan pekerjaan untuk orang lain.</p><p style=\"text-align: justify; \">Jadi jangan salah kaprah dalam penafsiran Koperasi, karena disinilah anda akan dilatih untuk menjadi seorang enterpreneurship yang handal, dalam bidang menegement maupun pelaksanaan dilapangan.</p><p style=\"text-align: justify; \">UKM Kopma Mandiri melakukan pertemuan rutin pada hari senin pukul 16.00 WIB, yangmana pertemuan ini dimaksudkan agar kegiatan mahasiswa khususnya kopma dapat termonitoring dan terkendali. Bukan hanya itu pertemuan ini dilakukan untuk membahas permasalahan-permasalahan yang terdapat pada tubuh UKM Kopma sendiri dsan nantinya akan dicari solusi dengan mufakat bersama.</p><div style=\"text-align: justify; \"><br></div>', '1671332452_9ec2dd1f856706c4a72e.jpg', 'ukm-kopma'),
(20, 'UKM Olahraga', '<p style=\"text-align: justify; \"><span lang=\"EN-US\" style=\"font-size: 11pt; line-height: 115%; font-family: Arial;\">UKM\r\nOlahraga resmi berdiri sesuai keputusan Sidang Umum Mahasiswa pada tanggal&nbsp; 03 Desember 2011 Pkl. 20.50 WIB. UKM Olahraga\r\nberubah dari Dirtjen olahraga&nbsp; yang\r\nberdiri dibawah naungan Badan Eksekutif Mahasiswa Politeknik Negeri Lampung\r\nsejak tahun 2001. Berlandaskan semangat yang tinggi dari 7 divisi sebagai\r\npenggagas awal dan demi memajukan perkembangan olahraga di Politeknik Negeri\r\nLampung, dari hasil beberapa kali rapat Internal Dirtjen Olahraga memberanikan\r\ndiri untuk mengajukan sebagai UKM Olahraga pada sidang umum mahasiswa 2011.\r\nTiga delegasi yang diutus untuk maju dalam Sidang Umum Mahasiswa 2011 yaitu\r\nAdhitya Kevin Prananda, Ridho Prasojo, Dan Soleh Ade Kusuma.</span><span style=\"font-family: Arial;\">﻿</span><br></p>', '1671889202_4a8075da1036d4438ed2.jpeg', 'ukm-olahraga'),
(26, 'BEM', '<p style=\"text-align: justify; \">Sebuah Organisasi yang menjadi eksekutor dalam menjalan semua program kerja yang telah dibentuk dalam sebuah rapat proker yakni lokakarya. Organisasi ini dibawah pengawasan langsung dari Ditjen Dikti dalam pelaksanaan dan lain sebagainya. BEM juga menjadi wadah yang mengatur jalan nya sistem semi kenegaraan yang dibentuk disetiap kampus baik universitas, intitusi, politeknik, sekolah tinggi dan lain sebagainya.</p>', '1674170510_e77e78f3e4abcb3dabf5.jpg', 'bem'),
(27, 'UKM Garda', '<p><span style=\"text-align: var(--bs-body-text-align); font-size: 15px; white-space: pre-wrap;\"><font color=\"#0f1419\" face=\"TwitterChirp, -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica, Arial, sans-serif\">UKM Garda (Garda Kedisiplinan) adalah salah satu Unit Kegiatan Mahasiswa (UKM) di Politeknik Negeri Lampung (Polinela) dan merupakan satu-satunya UKM yang bergerak dibidang </font></span><span style=\"color: rgb(15, 20, 25); font-family: TwitterChirp, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap;\"> menjunjung tinggi nilai-nilai </span>kedisiplinan<span style=\"color: rgb(15, 20, 25); font-family: TwitterChirp, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap;\">.</span><span style=\"text-align: var(--bs-body-text-align); font-size: 15px; white-space: pre-wrap;\"><font color=\"#0f1419\" face=\"TwitterChirp, -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica, Arial, sans-serif\">Garda memiliki peran yang cukup penting sebagai kontrol sosial secara menyeluruh di setiap mahasiswa dan bersifat membangun sikap kedisiplinan serta sebagai sumber panutan bagi civitas akademika Politeknik Negeri Lampung.</font></span><br></p>', '1674173224_6466caa0684f3c6a72d4.jpg', 'ukm-garda'),
(39, 'English Club', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; text-align: var(--bs-body-text-align); background-color: rgb(249, 249, 249); font-size: 15px; white-space: pre-wrap;\"><font color=\"#0f1419\" face=\"TwitterChirp, -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica, Arial, sans-serif\">UKM English Club adalah salah satu Unit Kegiatan Mahasiswa (UKM) di Politeknik Negeri Lampung (Polinela) dan merupakan satu-satunya UKM yang bergerak dibidang </font></span><span style=\"background-color: rgb(249, 249, 249); color: rgb(15, 20, 25); font-family: TwitterChirp, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap;\"> bahasa inggriss </span><span style=\"background-color: rgb(249, 249, 249); color: rgb(15, 20, 25); font-family: TwitterChirp, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap;\">.English Club </span><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; text-align: var(--bs-body-text-align); background-color: rgb(249, 249, 249); font-size: 15px; white-space: pre-wrap;\"><font color=\"#0f1419\" face=\"TwitterChirp, -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica, Arial, sans-serif\"> memiliki peran yang cukup penting sebagai penyeimbang memberikan semangat dalam belajar berbahasa inggris menyeluruh di setiap mahasiswa dan bersifat membangun dalam hal bahasa serta sebagai sumber panutan bagi civitas akademika Politeknik Negeri Lampung.</font></span><br></p>', '1674173636_31decc98fd8568ab4029.png', 'english-club');
